import React from "react";
import { useState, useEffect } from "react";
import Meal from "./components/menu/meal";

function Menu() {
  const [meals, setMeals] = useState([]);

  useEffect(() => {
    fetch(`${baseUrl}/meals`)
      .then((res) => res.json())
      .then((meals) => console.log(meals));
  });
  return <Meal />;
}

export default Menu;
